import React, { useState } from 'react';
import './SignUp.css';
import { useNavigate } from 'react-router-dom';


const SignUp = () => {
    const [name, setName] = useState("");
    const [password, setPassword] = useState("");
    const [email, setEmail] = useState("");

    const navigate = useNavigate(); // useNavigate hook'u kullanƒ±lƒ±yor.

    const handleLoginClick = () => {
        navigate('/login'); // /login sayfasƒ±na y√∂nlendirir.
    };

    const handleSignUp = async () => {
        const response = await fetch("http://localhost:5001/auth/signup",{
            method: "POST",
            headers: {
                "Content-Type": "application/json"
            },
            body: JSON.stringify({
                name: name,
                email: email,
                password: password
            })
        } )
        if(!response.ok) {
            console.log("Fetch atarken hata geldi!");
        }
        // Sign Up olduktan sonra yapƒ±lacak i≈ülemler gelecek
    };

  return (
    <div>
      <button className="login-button" onClick={handleLoginClick}>Giri≈ü Yap</button>
    <div className="signup-container">
      <div className="signup-box">
        <h2>MentUp&#39;a Kaydol</h2>
        <form>
          <div className="form-group">
            <label htmlFor="name">Ad Soyad</label>
            <input type="text" id="name" value={name} onChange={(e) => setName(e.target.value)} placeholder="John" required />
            </div>
          <div className="form-group">
            <label htmlFor="email">E-Posta</label>
            <input type="email" id="email" value={email} onChange={(e) => setEmail(e.target.value)} placeholder="johndoe@example.com" required />
            </div>
          <div className="form-group">
            <label htmlFor="password">≈ûifre</label>
            <div className="password-wrapper">
            <input type="password" id="password" value={password} onChange={(e) => setPassword(e.target.value)} placeholder="********" required />
            <button type="button" className="toggle-password">üëÅ</button>
            </div>
          </div>
          <div className="form-group checkbox">
            <input type="checkbox" id="terms" required />
            <label htmlFor="terms">Hizmet ≈ûartlarƒ±nƒ± ve Gizlilik Politikasƒ±nƒ± kabul ediyorum.</label>
          </div>
          <button type="submit" className="submit-button" onClick={handleSignUp}>KAYDOL</button>
        </form>
      </div>
      {/* <button className="login-button">Giri≈ü Yap</button> */}
    </div>
    </div>
  );
};

export default SignUp;

